import React, { useState } from 'react';
import styled from 'styled-components';
import Friend from './Friend';

const FriendsListBlock = styled.div`
  width: 22%;
  border: 2px solid #73b2ff;
  padding: 10px;
  border-radius: 10px;
  overflow-y: auto;
`;

const friendsList = [
  {
    profileImage: '1646621980718.jpeg',
    nickname: '123',
  },
  { profileImage: '1646702364540.jpeg', nickname: 'nani' },
  { nickname: 'abcd' },
];

const FriendsList = () => {
  return (
    <>
      <FriendsListBlock>
        {friendsList.map(({ profileImage, nickname }) => (
          <Friend
            key={nickname}
            profileImage={profileImage}
            nickname={nickname}
          />
        ))}
      </FriendsListBlock>
    </>
  );
};

export default FriendsList;
